import { library } from "@fortawesome/fontawesome-svg-core";
import { faListAlt } from "@fortawesome/free-regular-svg-icons";
import {
  faUser,
  faUserEdit,
  faUserCheck,
  faFileAlt,
  faFileDownload,
  faEdit,
  faHome,
} from "@fortawesome/free-solid-svg-icons";

library.add(
  faUser,
  faUserEdit,
  faUserCheck,
  faListAlt,
  faFileAlt,
  faFileDownload,
  faEdit,
  faHome
);
